import React from "react";
import { Link, Route, Routes, useParams } from "react-router-dom";

const markdownFiles = [
  {
    name: "카테고리1",
    post: [
      { name: "대학공부", content: "내용1" },
      { name: "유니티", content: "내용2" }
    ]
  },
  {
    name: "카테고리2",
    post: [
      { name: "대학공부", content: "내용1" },
      { name: "유니티", content: "내용2" }
    ]
  }
];

export default function Category() {
  return (
    <div>
      <h2>글</h2>

      <Routes>
        {markdownFiles.map((file, fileIndex) => (
          <Route key={fileIndex} path={`/blog/${file.name}`} element={<CategoryPosts category={file} />} />
        ))}
      </Routes>
    </div>
  );
}

function PostList() {
  return (
    <div>
      {markdownFiles.map((file, fileIndex) => (
        <div key={fileIndex}>
          <Link to={`/blog/${file.name}`}>
            <h3>{file.name}</h3>
          </Link>
        </div>
      ))}
    </div>
  );
}

function Post({ category }) {
  return (
    <div>
      <h3>{category.name}</h3>
      {category.post.map((post, postIndex) => (
        <div key={postIndex}>
          <h4>{post.name}</h4>
          <p>{post.content}</p>
        </div>
      ))}
    </div>
  );
}
